import './App.css';
import React from 'react';
import {Route, Routes, Link} from "react-router-dom"

// import {Main, Step1, Step2, Step3, Result} from "./components/Pages"
import Main from "./components/Pages/Main"
import Step1 from "./components/Pages/Step1"
import Step2 from "./components/Pages/Step2"
import Step3 from "./components/Pages/Step3"
import Result from "./components/Pages/Result"

// import Header from "./components/Header"

function App() {
  const Main = () => <>Main</>
  return (
    // <div className="App">
    //   <section>
    //   <div class="user-img">
    //     <span class="first-text">АИ</span>
    //   </div>
    //   </section>
    // </div>
    <>
       {/* <Header /> */}
      <Routes>
        <Route path='/' component={<Main/>}/>
        <Route path='/step1' component={<Step1/>}/>
        <Route path='/step2' component={<Step2/>}/>
        <Route path='/step3' component={<Step3/>}/>
        <Route path='/result' component={<Result/>}/>
      </Routes>
    </>

  );
}

export default App;
